svg.script:
(function () {
  "use strict";

  function init(){
    var arrowRightContainer = document.getElementById('arrow_right_container');
    var arrowLeftContainer = document.getElementById('arrow_left_container');
    var shield = document.getElementById('isometric_sheild');

    var arrowRight1 = document.getElementById('arrow_right');
    var arrowRight2 = document.getElementById('arrow_right-2');
    var arrowRight3 = document.getElementById('arrow_right-3');
    var arrowLeft1 = document.getElementById('arrow_left');
    var arrowLeft2 = document.getElementById('arrow_left-2');
    var arrowLeft3 = document.getElementById('arrow_left-3');

    new TimelineMax()
      .set(arrowRightContainer, {x:-270, y:50})
      .set([arrowRightContainer, arrowRight1, arrowRight3], {autoAlpha:0})
      .to(arrowRightContainer, .5, {x:-180, y:120, autoAlpha:1, ease:Power0.easeNone})
      .set([arrowRight2, arrowRight3], {autoAlpha:0})
      .set(arrowRight1, {autoAlpha:1})
      .to(arrowRightContainer, 1, {x:190, y:-100, ease:Power0.easeNone})
      .set([arrowRight1, arrowRight2], {autoAlpha:0})
      .set(arrowRight3, {autoAlpha:1})
      .to(arrowRightContainer, .5, {x:80, y:-170, autoAlpha:0, ease:Power0.easeNone})
      .repeat(-1).repeatDelay(2);

    new TimelineMax()
      .set(arrowLeftContainer, {x:310, y:-40})
      .set([arrowLeftContainer, arrowLeft1, arrowLeft2], {autoAlpha:0})
      .to(arrowLeftContainer, .5, {x:190, y:-110, autoAlpha:1, ease:Power0.easeNone})
      .set([arrowLeft2, arrowLeft3], {autoAlpha:0})
      .set(arrowLeft1, {autoAlpha:1})
      .to(arrowLeftContainer, 1, {x:-180, y:120, ease:Power0.easeNone})
      .set([arrowLeft1, arrowLeft3], {autoAlpha:0})
      .set(arrowLeft2, {autoAlpha:1})
      .to(arrowLeftContainer, .5, {x:-40, y:220, autoAlpha:0, ease:Power0.easeNone})
      .repeat(-1).repeatDelay(2);

    new TimelineMax()
      .to(shield, .6, {y:'+=30', ease:Power1.easeInOut})
      .to(shield, .6, {y:'-=30', ease:Power1.easeInOut})
      .repeat(-1);

  }
  window.addEventListener('load', init);
}());
